func getXorMask(a []byte, keyLength int) []byte {
	if len(a) <= keyLength {
		return nil
	}
	r := make([]byte, len(a)-keyLength)
	for i := keyLength; i < len(a); i++ {
		r[i-keyLength] = a[i] ^ a[i-keyLength]
	}
	return r
}

func arrayXor(a, b []byte) (c []byte) {
	c = make([]byte, len(a))
	for i := 0; i < len(a); i++ {
		c[i] = a[i] ^ b[i]
	}
	return
}

func rotateKey(arr []byte, d int) (ret []byte) {
	d = d % len(arr)
	ret = make([]byte, len(arr))
	for i := 0; i < len(arr); i++ {
		ret[(i+d)%len(arr)] = arr[i]
	}
	return
}

